import axios from 'axios';

export default async function checkNewFlag(flag) {
  return axios.put(`${process.env.REACT_APP_DEV_URL}ldps_workers`, flag)
    .then((res, err) => {
      return new Promise((resolve, reject) => {
        resolve(true)
        reject(err)
      })
    })
};
